import authService from "../services/AuthService";

export default {
  state: {},
  getters: {},
  mutations: {},
  actions: {
    async registration(_, formData) {
      const { data } = await authService.registration(formData);
      if (data.status === 200) {
        console.log("data", data);
      }
    },
  },
};
